def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    """Improved version of `priority_v2` with more complex logic."""
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        ratio = item / bins[i]

        if ratio < 0.3:
            priorities[i] = 2 * ratio + 0.5
        elif 0.3 <= ratio < 0.5:
            priorities[i] = 1.8 * ratio + 0.7
        elif 0.5 <= ratio < 0.7:
            priorities[i] = 1.5 * ratio + 0.8
        elif 0.7 <= ratio < 0.9:
            priorities[i] = 1.3 * ratio + 0.9
        elif 0.9 <= ratio < 1.2:
            priorities[i] = 1.1 * ratio + 1
        elif 1.2 <= ratio < 1.4:
            priorities[i] = ratio + 1.3
        elif ratio >= 1.4:
            priorities[i] = 0.8 * ratio + 1.5

    return priorities
